"use strict";var search={init:function(){var a=this;a.send()},send:function(){$("#search-form").submit(function(a){a.preventDefault(),$(this).serialize();var b=$("#query-field").val();$.ajax({type:"POST",data:{query:b},url:"member/search",dataType:"JSON"}).done(function(a){for(var b=[],c=0;c<a.length;c++){var d=a[c],e=d.NameFirst,f=d.NameLast,g=d.id,h="<li class='search-result'><a href='member/"+g+"'>"+e+" "+f+"</a></li>";b.push(h)}$(".search-results-list").html(b),a.length?$(".search-status-message").removeClass("failure").addClass("success").html("<p>"+a.length+" results found</p>"):$(".search-status-message").removeClass("success").addClass("failure").html("<p> No results found :(</p>")}).fail(function(){$(".search-status-message").removeClass("success").addClass("failure").html("<p> There was an error connecting to the database, try another time?</p>")})})}};$(document).ready(function(){search.init()});